def leftShift(nList: list, startIndex: int) -> None:
    for x in range(startIndex, len(nList)-1):
        nList[x] = nList[x+1]


def insertIntoList(nList: list, n: int) -> list:
    for idx, x in enumerate(nList):
        if n == x:
            leftShift(nList, idx)
            break
    *nList, _ = nList
    return nList


listSize = int(input())
numList = [int(x) for x in input().split()]
delNum = int(input())
numList = insertIntoList(numList, delNum)
for x in numList:
    print(x, end=" ")

